import List from "./List";
import { FaMinusSquare, FaPlusSquare, FaTrash } from "react-icons/fa";

const NewList = ({ list, onToggle, toggleList }) => {
  console.log(toggleList);
  return (
    <ul type="none">
      {Object.keys(list).length
        ? Object.keys(list).map((k) => (
            <>
              <li key={k}>
                {Object.keys(list[k]).length ? (
                  toggleList === k ? (
                    <span onClick={onToggle(k)}>
                      <FaPlusSquare
                        style={{
                          fontSize: "0.75rem",
                          paddingRight: "0.25rem",
                          cursor: "pointer",
                        }}
                      />
                    </span>
                  ) : (
                    <span onClick={onToggle(k)}>
                      <FaMinusSquare
                        style={{
                          fontSize: "0.75rem",
                          paddingRight: "0.25rem",
                          cursor: "pointer",
                        }}
                      />
                    </span>
                  )
                ) : null}
                {k}{" "}
                <FaTrash
                  style={{
                    cursor: "pointer",
                    float: "right",
                    marginRight: "40rem",
                    fontSize: "0.75rem",
                  }}
                />
              </li>
              <List
                list={list[k]}
                onToggle={onToggle}
                toggleList={toggleList}
              />
            </>
          ))
        : ""}
    </ul>
  );
};

export default NewList;
